import React, { useState } from 'react';

const redNumbers = [
  1, 3, 5, 7, 9, 12, 14, 16, 18, 19, 21, 23, 25, 27, 30, 32, 34, 36,
];

const Ruleta: React.FC = () => {
  const [selectedBet, setSelectedBet] = useState<'red' | 'black' | 'even' | 'odd' | 'number'>('red');
  const [betNumber, setBetNumber] = useState<number | ''>('');
  const [result, setResult] = useState<number | null>(null);
  const [message, setMessage] = useState('');

  const spinRoulette = () => {
    if (selectedBet === 'number' && (betNumber === '' || betNumber < 0 || betNumber > 36)) {
      setMessage('‚ö†Ô∏è Introdu un numƒÉr valid √Æntre 0 »ôi 36!');
      return;
    }

    const roll = Math.floor(Math.random() * 37); // 0-36
    setResult(roll);

    const isRed = redNumbers.includes(roll);
    const isBlack = roll !== 0 && !isRed;
    const isEven = roll !== 0 && roll % 2 === 0;
    const isOdd = roll % 2 === 1;

    let won = false;
    let payout = 0;

    switch (selectedBet) {
      case 'red':
        won = isRed;
        payout = 2;
        break;
      case 'black':
        won = isBlack;
        payout = 2;
        break;
      case 'even':
        won = isEven;
        payout = 2;
        break;
      case 'odd':
        won = isOdd;
        payout = 2;
        break;
      case 'number':
        won = Number(betNumber) === roll;
        payout = 36;
        break;
    }

    if (won) {
      setMessage(`üëë FelicitƒÉri! Ai c√¢»ôtigat x${payout}`);
    } else {
      setMessage('üò¢ Ai pierdut. √éncearcƒÉ din nou!');
    }
  };

  return (
    <div
      style={{
        minHeight: '100vh',
        background: 'linear-gradient(to bottom right, #1a1a2e, #3a0ca3)',
        color: '#f1f1f1',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        padding: '2rem',
        fontFamily: '"Segoe UI", sans-serif',
      }}
    >
      <h1 style={{ fontSize: '2.5rem', marginBottom: '1.5rem', color: '#ffd700', textShadow: '0 0 10px #ffd700' }}>
        üëë Shiny Crown RuletƒÉ
      </h1>

      <div style={{ marginBottom: '1rem' }}>
        <label htmlFor="bet-type-select" style={{ fontWeight: 'bold' }}>Tip pariu:</label>
        <select
          id="bet-type-select"
          value={selectedBet}
          onChange={(e) => {
            setSelectedBet(e.target.value as any);
            setMessage('');
            setResult(null);
          }}
          style={selectStyle}
        >
          <option value="red">Ro»ôu üî¥</option>
          <option value="black">Negru ‚ö´</option>
          <option value="even">Par ‚ôªÔ∏è</option>
          <option value="odd">Impar ‚òùÔ∏è</option>
          <option value="number">NumƒÉr exact üî¢</option>
        </select>
      </div>

      {selectedBet === 'number' && (
        <div style={{ marginBottom: '1rem' }}>
          <label style={{ fontWeight: 'bold' }}>NumƒÉr (0 - 36):</label>
          <input
            type="number"
            min={0}
            max={36}
            value={betNumber}
            onChange={(e) => setBetNumber(Number(e.target.value))}
            style={inputStyle}
            placeholder="Ex: 17"
          />
        </div>
      )}

      <button onClick={spinRoulette} style={buttonStyle}>
        RuleazƒÉ roata! üé∞
      </button>

      {result !== null && (
        <div style={{ marginTop: '2rem', fontSize: '22px', color: '#ffd700' }}>
          Rezultat: <strong>{result}</strong>{' '}
          {result === 0 ? 'üü¢' : redNumbers.includes(result) ? 'üî¥' : '‚ö´'}
        </div>
      )}

      {message && (
        <div style={{ marginTop: '1rem', fontSize: '20px', fontWeight: '600', color: '#ffde59' }}>
          {message}
        </div>
      )}
    </div>
  );
};

const buttonStyle: React.CSSProperties = {
  padding: '12px 28px',
  backgroundColor: '#ffd700',
  border: 'none',
  borderRadius: '12px',
  color: '#000',
  fontSize: '18px',
  fontWeight: 'bold',
  cursor: 'pointer',
  boxShadow: '0 0 15px rgba(255, 215, 0, 0.7)',
  transition: 'transform 0.2s ease',
};

const selectStyle: React.CSSProperties = {
  marginLeft: '10px',
  padding: '6px 12px',
  borderRadius: '8px',
  border: '1px solid #ffd700',
  backgroundColor: '#111',
  color: '#ffd700',
  fontSize: '16px',
};

const inputStyle: React.CSSProperties = {
  marginLeft: '10px',
  padding: '6px 12px',
  width: '100px',
  borderRadius: '8px',
  border: '1px solid #ffd700',
  backgroundColor: '#111',
  color: '#ffd700',
  fontSize: '16px',
};

export default Ruleta;
